        <IconContext.Provider value = {{size:'2rem', color: 'black'}}>

        <div className = "col btn-toolbar border rounded-pill bg-white align-self-end align-self-right mb-1 ml-5" role = "toolbar" style = {{width: "170px"}} >
            <a className = "ml-2 mt-2 mb-2" href = "#">
                <FaGithub/>
            </a>

            <a className = "m-2" href = "#">
                <FaTwitterSquare/> 
            </a>

            <a className = "mt-2 mr-2" href = "#">
                <FaInstagram/>
            </a>

        </div>
        </IconContext.Provider>
     );
}

export default Socialnet;
